import propTypes from 'prop-types'
function Student(props){
    
    return(
        <div>
            <p>name: {props.name}</p>
            <p>age:{props.age}</p>
            <p>student:{props.isStudent ? "yes":"no"}</p>
        </div>
    )
}
Student.prototype={
    name: propTypes.string,
    age:propTypes.number,
    isStudent: propTypes.bool,

}
Student.defaultProps = {
    name:"guest",
    age: 0,
    isStudent: false,
}
export default Student
